      try {
        const end = process.hrtime();

        // Calculate elapsed time in milliseconds
        const elapsedTime = ((end[0] - start[0]) * 1000000 + end[1] - start[1]);

        res.setHeader('X-Nuxt-Coldstart', global._coldstart + 'ms');
